        return true
    }

    return ( 
    <form>
        <div>
            <label>1. Age: </label>
            <input type = "number" onChange={checkInput}/>
            
        </div>
        <div>
            <label>2. Gender:</label>
            <CheckBox optionArray = {optionTwo} />
        </div>
        <div>
            <label>3. Ethnicity:</label>
            <CheckBox optionArray={optionThree} />
        </div>
        <div>
            <label>4. Primary Language you speck: </label>
            <input type = "text" />
        </div>
        <div>
            <label>5. Country you live: </label>
            <input type = "text" />
        </div>
        <Link to="/questiontwo"><NextButton disabled = {false} /></Link>
    </form>
     );
}
 
export default QuestionOne;
